SELECT table_name.column_name , table_name.column_name , table_name.column_name , COUNT ( DISTINCT table_name.column_name ) AS column_label FROM table_name AS table_name JOIN column_name AS column_label ON table_name.column_name = table_name.column_name WHERE table_name.column_name <> 'Brand#45' AND table_name.column_name NOT LIKE 'MEDIUM POLISHED%' AND table_name.column_name IN ( 49 , 14 , 23 , 45 , 19 , 3 , 36 , 9 ) AND table_name GROUP BY table_name.column_name , table_name.column_name , table_name.column_name ORDER BY column_name DESC , table_name.column_name , table_name.column_name , table_name.column_name 